import { useSelector } from 'react-redux';


// Custom Hook ที่ใช้ในการเรียกใช้ Hook useSelector ในฟังก์ชัน
export const useYourSelector = () => {

    const boards = useSelector((state) => {
        return state.boards.boards
      });
    return boards

};
